options.filter(_ => _.name === answers.testRunner)[0] && {
  name: CommandTestRunner.runnerName,
  pkg: null
}

coverageData || Object.entries(coverageData).forEach(([testId, coverageData]) => {
  const test = allTests.find(test => test.id === testId);

  if (!test) {
    throw new Error(`Found test with id "${testId}" in coverage data, but not in the test results of the dry run. This shouldn't happen! Please report the issue at the issue tracker of your stryker test runner`);
  }

  Object.entries(coverageData).forEach(([mutantIdAsString, count]) => {
    if (count) {
      const mutantId = parseInt(mutantIdAsString, 10);
      let tests = testsByMutantId.get(mutantId);

      if (!tests) {
        tests = new Set();
        testsByMutantId.set(mutantId, tests);
      }

      tests.add(test);
    }
  });
})
